INSERT INTO `berita` (`id_berita`, `id_user`, `judul_berita`, `kategori_berita`, `gambar_berita`, `isi_berita`, `status_berita`, `waktu_update`, `waktu_post`) VALUES
(1, 1, 'Digitalisasi Ekonomi Desa Jadi Program Utama Kemendes PDTT', 'Program Pemerintah', 'Desa_Digital.jpg', 'Menteri Desa, Pembangunan Daerah Tertinggal dan Transmigrasi (Mendes PDTT) Abdul Halim Iskandar mengatakan, digitalisasi ekonomi desa menjadi salah satu program utama dalam upaya pembangunan desa \"Apalagi pada masa pandemi Covid-19 ini, digitalisasi ekonomi dapat membantu memasarkan berbagai potensi dan produk yang dihasilkan oleh desa dengan lebih mudah,\" katanya seperti dalam keterangan tertulisnya, Senin (14/12/2020). Dia mengatakan itu saat menjadi pembicara kunci dalam webinar yang diselenggarakan Program Studi Pengembangan Masyarakat Islam, Fakultas Dakwah dan Komunikasi Universitas Islam Negeri (UIN) Sunan Kalijaga (SUKA) Yogyakarta, Senin (16/11/2020). Menteri yang akrab disapa Gus Menteri ini menyatakan, ada dua hal yang diuntungkan dengan adanya digitalisasi ekonomi. Pertama, memutus mata rantai penyebab harga barang mahal ketika diterima konsumen. Kedua, mendekatkan antara pembeli dan penjual. Oleh karena itu, dirinya berupaya secara maksimal agar Program Studi Pengembangan Masyarakat Islam, UIN SUKA Yogyakarta dapat menjadi bagian penting dari pembangunan desa. “Karena pada kenyataannya, di desa sangat membutuhkan pengembang masyarakat utamanya terkait dengan agama, khususnya agama Islam. Karena kami maklumi, Indonesia mayoritas agamanya adalah pemeluk agama Islam,” ujarnya. Lebih lanjut, dia mengatakan pemasaran menjadi masalah yang paling banyak dihadapi di desa. Padahal, banyak desa yang punya potensi bagus. Maka dari itu, guna mengatasi masalah tersebut, desa perlu menemukan offtaker atau penjamin. \"Offtaker tersebut diharapkan mampu menjadi media untuk mentransformasi berbagai potensi desa menuju ke wilayah yang dituju, yaitu pasar domestik maupun pasar internasional,\" jelasnya. Sebelumnya, Gus Menteri menegaskan, digitalisasi menjadi bagian penting sebagai upaya untuk mempercepat pembangunan desa. “Kenapa digitalisasi menjadi bagian penting? Kita tidak bisa kemudian terus melakukan atau berposisi pada posisi hari ini, di mana tuntutan zaman, tuntutan perkembangan, tuntutan situasi kita terus bergerak menuju pada satu situasi yang disebut zaman digital,” ujarnya.', 'Tampilkan', '2021-05-03 06:37:10', '2021-05-03 09:11:06'),
(5, 1, 'Bangun Desa Digital, Tingkatkan Kapasitas SDM di Bidang TI', 'Teknologi', 'Kominfo_Desa_Digital1.jpg', 'Era perkembangan teknologi informasi (TI) memberikan tantangan dalam pembangunan ekonomi desa. Desa dituntut harus mampu beradaptasi mengikuti kemajuan teknologi dengan mengurangi kesenjangan digital melalui pengembangan desa digital. Untuk itu, peningkatan sumber daya manusia yang paham digital sangat dibutuhkan dalam pengembangan desa digital agar mampu menggerakkan dan memberikan manfaat ekonomi bagi masyarakat.\r\n\r\n“Prinsip pembangunan desa harus menjadikan warga desa sebagai subyek pembangunan. Untuk itu, diperlukan peningkatan kapasitas sumber daya manusia (SDM) desa melalui kegiatan pelatihan, pendampingan dan literasi digital untuk membentuk SDM talenta digital,” tegas Wakil Presiden (Wapres) K. H. Ma’ruf Amin pada Webinar Desa Digital 2020 di kediaman resmi Wapres, Jl. Diponegoro No. 2, Jakarta, Sabtu (07/11/2020).\r\n\r\nWapres menyebutkan bahwa tema “Desa Digital Tol Langit” yang diangkat pada acara ini sangat relevan dengan arah kebijakan pemerintah. Pemerintah terus berupaya meningkatkan percepatan akses dan pembangunan infrastruktur digital untuk melayani publik secara cepat dan efisien.\r\n\r\n“Pemerintah telah menyiapkan anggaran sebesar Rp 30,5 triliun untuk mempercepat transformasi digital penyelenggaraan pemerintahan yang salah satunya adalah untuk pembangunan akses internet di 4.000 desa dan kelurahan di daerah tertinggal, terdepan dan terluar (3T) di Indonesia. Sampai saat ini telah terdapat 233 desa yang menjadi contoh desa digital di Indonesia,” papar Wapres.', 'Tampilkan', '2021-05-03 06:36:40', '2021-05-03 07:22:05'),
(6, 1, 'Teknologi Tepat Guna untuk Pembangunan Masyarakat Desa', 'Pembangunan', 'ttg.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp; Gelaran acara Teknologi Tepat Guna Nasional (TTGN) XXI tahun 2019 yang dipusatkan di Sport Center Bengkulu telah dibuka secara resmi oleh Menteri Desa, Pembangunan Daerah Tertinggal dan Transmigrasi, Eko Putro Sandjojo, pada Minggu, 22 September 2019. TTGN XXI yang digelar di Bengkulu ini mengambil tema &ldquo;Melalui Gelar TTGN, Kita Tingkatkan Inovasi Teknologi Perdesaan Menyongsong Industri 4.0&rdquo;. Berdasarkan tema tersebut, Eko menuturkan bahwa era revolusi industri 4.0 ini bertujuan mempermudah proses produksi dan manufakturing. &quot;Nah, dengan adanya teknologi 4.0 ini diharapkan nantinya masyarakat dapat terbantu terkait hal-hal yang tadinya sulit atau susah dijalankan oleh masyarakat yang pendidikannya mungkin masih kurang,&quot; kata Eko disela-sela melakukan peninjauan stan pameran produk-produk TTG dari berbagai daerah di Indonesia.</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; Teknologi yang membantu, lanjut Eko, misalnya adalah aplikasi Sistem Keuangan Desa (Siskeudes) yang memiliki tujuan memudahkan aparat pemerintah desa saat melakukan proses pengelolaan keuangan&lrm;. Selain itu, hal ini perlu agar keuangan desa dapat dipertanggungjawabkan akuntabilitasnya. &quot;Contohnya sistem siskeudes, yang tadinya pelaporannya susah, dengan adanya sistem siskeudes ini, banyak kades yang tidak sekolah pun sudah bisa membuat laporan keuangan negara. Jadi, kita berharap bagaimana penggiat-penggiat 4.0 ini dapat membantu membuat aplikasi, sehingga masyarakat yang tidak siap dapat menjadi siap dan merasakan manfaat dengan teknologi 4.0,&quot; katanya. Eko berpendapat bahwa TTGN merupakan event nasional tahunan sejak tahun 1999 yang bertujuan mempercepat alih teknologi dari inventor TTG kepada masyarakat, khususnya pelaku TTG di desa.</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; Gelaran TTGN adalah salah satu upaya strategis untuk memotivasi masing-masing daerah untuk dapat mengembangkan teknologi. Selain itu, sebagai upaya dalam menyebarluaskan informasi berbagai teknologi yang dapat memberi nilai tambah kepada masyarakat. Jadi, berbagai jenis TTG dan produksinya secara visual ditampilkan dalam gelaran ini agar masyarakat memperoleh informasi yang cukup untuk menerapkannya. &quot;Gelaran TTGN ini dapat menambah pengetahuan dan wawasan masyarakat tentang perkembangan dan kemajuan teknologi serta manfaatnya, dalam rangka peningkatan mutu dan kuantitas produksi di berbagai sektor usaha. Untuk teknologi yang diperlukan dan dibutuhkan masyarakat, haruslah teknologi yang tepat sasaran, sesuai dengan kebutuhan masyarakat dan mudah cara penggunaannya,&quot;</p>\r\n', 'Tampilkan', '2021-05-03 18:28:43', '2021-05-03 07:38:29');
