(1, 'Pemerintahan', 'pemerintahan.png', '<h3 style=\"text-align:center\">SUSUNAN ORGANISASI DAN TATA KERJA PEMERINTAH DESA</h3>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<div style=\"text-align:justify\">Kepala Desa bertugas menyelenggarakan Pemerintahan Desa, melaksanakan pembangunan, pembinaan kemasyarakatan, dan pemberdayaan masyarakat. Untuk melaksanakan tugas Kepala Desa memiliki fungsi-fungsi sebagai berikut:</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div>1. Menyelenggarakan Pemerintahan Desa, seperti tata praja Pemerintahan, penetapan peraturan di desa, pembinaan masalah pertanahan, pembinaan ketentraman dan ketertiban, melakukan upaya perlindungan masyarakat, administrasi kependudukan, dan penataan dan pengelolaan wilayah.</div>\r\n\r\n<div>2. Melaksanakan pembangunan, seperti pembangunan sarana prasarana perdesaan, dan pembangunan bidang pendidikan, kesehatan.</div>\r\n\r\n<div>3. Pembinaan kemasyarakatan, seperti pelaksanaan hak dan kewajiban masyarakat, partisipasi masyarakat, sosial budaya masyarakat, keagamaan, dan ketenagakerjaan.</div>\r\n\r\n<div>4. Pemberdayaan masyarakat, seperti tugas sosialisasi dan motivasi masyarakat di bidang budaya, ekonomi, politik, lingkungan hidup, pemberdayaan keluarga, pemuda, olahraga, dan karang taruna.</div>\r\n\r\n<div>5. Menjaga hubungan kemitraan dengan lembaga masyarakat dan lembaga lainnya.</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">Sekretaris Desa berkedudukan sebagai unsur pimpinan Sekretariat Desa. Sekretaris Desa bertugas membantu Kepala Desa dalam bidang administrasi pemerintahan. Untuk melaksanakan tugas, Sekretaris Desa mempunyai fungsi:</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div>1. Melaksanakan urusan ketatausahaan seperti tata naskah, administrasi surat menyurat, arsip, dan ekspedisi.</div>\r\n\r\n<div>2. Melaksanakan urusan umum seperti penataan administrasi perangkat desa, penyediaan prasarana perangkat desa dan kantor, penyiapan rapat, pengadministrasian aset, inventarisasi, perjalanan dinas, dan pelayanan umum.</div>\r\n\r\n<div>3. Melaksanakan urusan keuangan seperti pengurusan administrasi keuangan, administrasi sumber-sumber pendapatan dan pengeluaran, verifikasi administrasi keuangan, dan admnistrasi penghasilan Kepala Desa, Perangkat Desa, BPD, dan lembaga pemerintahan desa lainnya.</div>\r\n\r\n<div>4. Melaksanakan urusan perencanaan seperti menyusun rencana anggaran pendapatan dan belanja desa, menginventarisir data-data dalam rangka pembangunan, melakukan monitoring dan evaluasi program, serta penyusunan laporan.</div>\r\n\r\n<div id=\"simple-translate\">\r\n<div>\r\n<div class=\"isShow simple-translate-button\" style=\"background-image:url(&quot;moz-extension://985ec790-edd5-4024-bb81-27922e5a807b/icons/512.png&quot;); height:22px; left:603px; top:43px; width:22px\">&nbsp;</div>\r\n\r\n<div class=\" simple-translate-panel\" style=\"background-color:#ffffff; font-size:13px; height:200px; left:0px; top:0px; width:300px\">\r\n<div class=\"simple-translate-result-wrapper\" style=\"overflow:hidden\">\r\n<div class=\"simple-translate-move\" draggable=\"true\">&nbsp;</div>\r\n\r\n<div class=\"simple-translate-result-contents\">\r\n<p class=\"simple-translate-result\" dir=\"auto\" style=\"color:#000000\">&nbsp;</p>\r\n\r\n<p class=\"simple-translate-candidate\" dir=\"auto\" style=\"color:#737373\">&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', '2021-05-04 03:18:12'),
