(3, 'Visi & Misi', 'visi-misi.png', '<h3 style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\"><strong>VISI</strong></span></h3>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<div style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\"><strong>KERTA RAHARJA</strong> artinya Mewujudkan Desa Akah yang damai dan Sentosa , Sejahtera , sehat , demokratis berbasis pada ekonomi pertanian , kerajinan dan pariwisata.</span></div>\r\n\r\n<div style=\"text-align:center\">&nbsp;</div>\r\n\r\n<div style=\"text-align:left\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Visi adalah suatu gambaran umum tentang keadaan masa depan yang ingin dicapai dengan melihat potensi dan kebutuhan desa. Maka konsep Visi Pembangunan Desa dalam kurun waktu 2015 hingga 2020.</span></div>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<h3 style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\"><strong>MISI</strong></span></h3>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<div style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">1. Mengutamakan pemberdayaan potensi pertanian untuk menunjang sumber pendapatan dan kesejahteraan masyarakat desa sebagai sentra kegiatan pokok.</span><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">2. Meningkatkan kualitas Sumber Daya Manusia melalui Program pendidikan dan program kesehatan serta pengamalan ajaran agama kepada masyarakat.</span><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">3.Menggali , melestarikan dan mengembangkan nilai - nilai&nbsp; budaya desa</span><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">4. Meningkatkan ketahanan ekonomi dengan menggalakkan usaha ekonomi kerakyatan melalui program strategi dibidang produksi ekonomi pertanian , kerajinan, pariwisata.</span><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">5. Meningkatkan partisipasi masyarakat dalam menumbuh kembangkan kesadaran dan kemandirian dalam&nbsp; pembangunan desa yang berkelanjutan.</span><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">6. Menciptakan suasana yang aman dan tertib dalam kehidupan bermasyarakat.</span><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">7. Meningkatkan pelayanan kepada masyarakat dan kerjasama anat lembaga pemerintahan di desa serta lembaga adat.</span><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">8. Memberdayakan masyarakat dengan mengoptimalkan potensi yang ada menuju masyarakat mandiri dan sejahtera.</span></div>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<h3 style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\"><strong>TUJUAN</strong></span></h3>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<div style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Meningkatkan taraf hidup masyarakat yang mencakup bidang kesehatan, bidang pendidikan sosial dan aspek kehidupan lainnya sehingga kesejahteraan masyarakat dapat tercapai sesuai dengan harapan kita semua.</span></div>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<h3 style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\"><strong>SASARAN</strong></span></h3>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<div style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Seluruh masyarakat Desa Akah sehingga masyarakat dapat bekerja lebih optimal serta penghasilan dapat meningkat.</span></div>\r\n', '2021-05-04 03:20:53'),
(4, 'Profil Potensi Desa', 'potensi.png', '<h3 style=\"text-align:center\">Profil Potensi Desa Desoo</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><strong>Potensi Desa</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Beberapa potensi desa yang dapat dijadikan modal dasar pembangunan di Desa Akah , dalam kurun waktu 6 tahun mendatang adalah :</div>\r\n\r\n<div><br />\r\n1. Sumberdaya alam , Lahan / tanah pertanian yang cukup luas , sumber mata air .<br />\r\n2. Sumberdaya alama persawahan yang luas&nbsp; menyajikan panorama yang indah sebagai daya tarik wisata alam.<br />\r\n3. Sumberdaya manusia , jumlah penduduk yang cukup banyak dengan usia produktif yang terdidik dan terampil.<br />\r\n4. Letak Geografis yang strategis , persawahan dan perkebunan terhampar luas sehingga menjadi potensial untuk dikembangkan bagi sektor pertanian.<br />\r\n5. Kehidupan sosial budaya masyarakat yang beraneka ragam , terdiri dari berbagai agama yang berbeda berdampingan secara harmonis menjadi simbol terjaganya kerukunan hidup yang aman , damai sehingga menjadi modal dalam mengembangkan pariwisata dibidang budaya , agama maupun wisata alam.</div>\r\n', '2021-05-04 03:20:05'),
(5, 'Profil Masyarakat Desa', 'masyarakat.png', '<h3 style=\"text-align:center\">Profil Masyarakat Desa Desoo</h3>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<div style=\"text-align:justify\">Desa Nyalian merupakan salah satu Desa yang mempunyai jumlah penduduk paling banyak antara Desa lainnya Di Kecamatan Banjarangkan, Kabupaten Klungkung, namun secara kewilayahan Desa Nyalian memiliki luas wilayah terbesar ke 2(dua) setelah Desa Takmung. Hal tersebut membuktikan bahwa Desa Nyalian memiliki keadaan penduduk yang cukup padat. Jumlah penduduk Desa Nyalian&nbsp; berdasarkan hasil sensus pada bulan Januari tahun 2019, adalah sebanyak 5569 jiwa, terdiri dari 2776 jiwa penduduk laki-laki dan 2793 jiwa penduduk perempuan, yang terdiri dari 1244 KK. Sedangkan jumlah RTM sabanyak 165 RTM.</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Struktur penduduk menurut pendidikan menunjukkan kualitas sumber daya manusia yang dipunyai Desa Nyalian, yaitu yang berusia pada usia pendidikan dasar 7 tahun s/d 16 tahun (pendidikan sekolah dasar dan menengah)&nbsp; yang belum pernah sekolah sedang mengikuti pendidikan dan sisanya&nbsp; tidak bersekolah lagi.</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">Sedangkan yang berusia diatas 16 tahun&nbsp; (diatas usia pendidikan dasar) yang belum pernah sekolah, sedang mengikuti pendidikan&nbsp; dan sisanya&nbsp; tidak bersekolah lagi, baik pada tingkat lanjutan dan perguruan tinggi.&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div>Struktur penduduk menurut agama menunjukkan sebagian besar penduduk Desa Nyalian beragama Hindu (100 %).</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Seiring berjalannya waktu data hasil sensus tahun 2019 tentunya telah mengalami perubahan, dengan sistem SID ini data lebih mudah diperbarui dikarenakan telah kerjakan oleh sistem komputer. Silahkan klik menu <strong>data desa</strong> pada header bar pada web ini&nbsp;untuk mendapatkan tampilan data statistik per kategori.&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Data yang tampil adalah statistik yang didapatkan dari proses olah data dasar yang dilakukan secara&nbsp;<em>offline</em>&nbsp;di kantor desa secara rutin/harian. Data dasar di kantor desa diunggah ke dalam sistem&nbsp;<em>online</em>&nbsp;di website ini secara berkala. Silahkan hubungi kontak pemerintah desa untuk mendapatkan data dan informasi desa termutakhir.</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\"><strong>Profil sosial masyarakat</strong></div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Kebudayaan daerah Desa Nyalian tidak terlepas dan diwarnai oleh Agama Hindu dengan konsep &ldquo;Tri Hita Karana&rdquo; (hubungan yang selaras, seimbang dan serasi antara manusia dengan Tuhannya, manusia dengan manusia dan manusia dengan lingkungannya). Dalam aktivitas keseharian, masyarakat Desa Nyalian sangat taat dalam menjalankan kegiatan keagamaan. Luas wilayah wilayah Desa Nyalian secara adat terbagi menjadi 4 (empat) Desa Pakraman yang terdiri dari (1). Desa Pakraman Nyalian mencakup 5 (lima) Banjar Dinas yaitu : Banjar Dinas Pekandelan, Geria, Kelodan, Kapit dan Dukuh. (2) Desa Pakraman Umanyar hanya mencakup Banjar Dinas Umanyar, (3) Desa Pakraman Pemenang hanya mencakup Banjar Dinas Pemenang, (4) Desa Pakraman Tegalwangi juga hanya mencakup Banjar Dinas Tegalwangi.&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Masing-masing Desa Pakraman mempunyai Organisasi Bendesa yang mengatur segala kegiatan adat yang diwilayahi, serta bertanggungjawab terhadap Pura Kahyangan Tiga (Puseh, Pura Bale Agung, Dalem) yang ada di setiap Desa Pakraman. Pada peringatan hari besar Hindu dan Hari Piodalan di Pura Kahyangan Desa, penduduk Desa Adat di Desa Nyalian kerap menggelar upacara peringatan hari besar keagamaan dan tradisi tersebut.</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">Dalam rangka memperingati Hari Kemerdekaan Republik Indonesia setiap masyarakat akan turut serta dan semangat&nbsp; dalam acara peringatan tersebut.</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Kelompok pemuda di Desa Nyalian yang tergabung dalam kelompok pegiat Karang Taruna menjadi aktor utama dalam banyak kegiatan desa. Kelompok ini aktif menggelar program kegiatan untuk isu demokrasi kepada warga, pelatihan penanggulangan bencana, dan kampanye Gerakan Remaja Anti Narkoba dan Seks Bebas. Kelompok Pemuda di Desa Nyalian yang tergabung dalam Sekaha Teruna Teruni (STT) pada setiap Banjar Adat maupun Dinas, tergabung manjadi Kader Gerakan Bersama Kader Anti Rokok (Kader GEBRAK), mendukung penuh Peraturan Bupati Klungkung dalam mewujudkan Kabupaten Klungkung yang bersih dari asap Rokok.</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Permasalahan mendasar yang ada di Desa Nyalian adalah ketidak seimbangan antara potensi dan mayoritas sumber daya alam yang berada di Desa Nyalian merupakan lahan pertanian serta perkebunan, sedangkan mayoritas penduduknya lebih memilih mencari mata pencaharian di sektor lain seberti pertukangan, industri perhotelan dan jasa lainnya. Namun hai ini tentunya dipengaruhi beberapa faktor penyebabnya, mulai dari telah terbatasnya sumber air, dan kualitas panen yang memburuk. Faktor tersebut menjadi penyebab utama peralihan jenis tanam dan minat usaha yang hingga kini masih menjadi PR yang harus dipecahkan di Desa Nyalian.</div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div><strong>Profil Politik Masyarakat</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Masyarakat Desa Nyalian sudah mengenal sistem demokrasi secara dinamis, serta memilikim partisipasi politik yang cukup besar. Keadaan pendudukanya yang besar juga mempengaruhi keberagaman pada kondisi polotik di Desa Nyalian, sehingga benyak dari pemilik kepentingan politik yang memperhitungkannya. Kendati demikian kondisi politik di Desa Nyalian masih tetap kondusif serta menjunjung tinggi nilai-nilai demokrasi.</div>\r\n', '2021-05-04 03:19:32'),
(6, 'Profil Wilayah Desa', 'wilayah.png', '<h3 style=\"text-align:center\">Profil Wilayah Desa Desoo</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\"><strong>1. KONDISI GEOGRAFI</strong></span></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Desa Akah merupakan salah satu desa dalam wilayah Kecamatan Klungkung Kabupaten Klungkung, dengan jarak 3 km dari Pusat Kota Kabupaten, terbagi menjadi 6 (enam) wilayah Banjar Dinas dan 6 (enam) Banjar Adat.&nbsp;</span><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Wilayah-wilayah Banjar Dinas dan Banjar Adat yaitu:</span></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<ul>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Wilayah Banjar Gingsir</span></strong></span></div>\r\n	</li>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Wilayah Banjar Gede</span></strong></span></div>\r\n	</li>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Wilayah Banjar Pekandelan</span></strong></span></div>\r\n	</li>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Wilayah Banjar Tengah</span></strong></span></div>\r\n	</li>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Wilayah Banjar Bungaya</span></strong></span></div>\r\n	</li>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Wilayah Banjar Sangging</span></strong></span></div>\r\n	</li>\r\n</ul>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\"><strong>2. BATAS-BATAS DESA</strong></span></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Desa adalah desa dan desa adat atau yang disebut dengan nama lain, selanjutnya disebut Desa, adalah kesatuan masyarakat hukum yang memiliki batas wilayah yang berwenang untuk mengatur dan mengurus urusan pemerintahan, kepentingan masyarakat setempat berdasarkan prakarsa masyarakat, hak asal usul, dan/atau hak tradisional yang diakui dan dihormati dalam sistem pemerintahan Negara Kesatuan Republik Indonesia.&nbsp;</span></div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Berkenaan dengan batas wilayah Desa Akah telah jelas sesuai dengan hasil kesepakatan batas desa dengan desa tetangga yaitu : Desa Selat dan Selisihan sesuai dengan dokumen batas wilayah antar desa dan desa dengan kelurahan di Kecamatan Klungkung yang ditetapkan dengan Keputusan Bupati Klungkung Nomor 280 Tahun 2007 Tentang Penetapan Batas Antar Desa dan Antar Desa dengan Kelurahan se-Kecamatan Klungkung-Kabupaten Klungkung dengan jelasnya batas wilayah desa akan memperjelas kewenangan yuridiksi dan mempermudah pelaksanaan pemerintahan, pembangunan, dan pembinaan kemasyarakatan.&nbsp;</span><span style=\"background-color:#ffffff; color:#626262; font-family:arial,helvetica,sans-serif; font-size:16px\">&nbsp;</span><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Sesuai dengan kesepakatan bersama antar desa-desa yang bersebelahan, maka Desa Akah berbatasan dengan desa-desa sebagai berikut :</span></div>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<ul>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Batas Sebelah Utara&nbsp; &nbsp; &nbsp; :&nbsp; &nbsp;Desa Selat Kecamatan Klungkung</span></strong></span></div>\r\n	</li>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Batas Sebelah Timur&nbsp; &nbsp; &nbsp;:&nbsp; Tukad Unda Kecamata Sidemen</span></strong></span></div>\r\n	</li>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Batas Sebelah Selatan&nbsp; :&nbsp; &nbsp;Kelurahan Semarapura Kangin dan Semarapura Kaja</span></strong></span></div>\r\n	</li>\r\n	<li>\r\n	<div><span style=\"font-size:12pt\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Batas Sebelah Barat&nbsp; &nbsp; &nbsp; :&nbsp; Tukad Kunyit / Desa Manduang Kecamatan Klungkung</span></strong></span></div>\r\n	</li>\r\n</ul>\r\n\r\n<div style=\"text-align:justify\">&nbsp;</div>\r\n\r\n<div style=\"text-align:justify\"><span style=\"font-family:arial,helvetica,sans-serif; font-size:12pt\">Desa Akah memiliki luas wilayah secara keseluruhan &plusmn; 224,4 Ha atau 2,244 km.&nbsp;Keadaan tanah di Desa Akah adalah tanah kering, dengan luas pemukiman penduduk sebanyak 10%, daerah pertanian kering 66%, dan 24% tanah fasilitas lainnya. Desa Akah mempunyai iklim tropis dengan udara yang cukup sejuk, tidak jauh berbeda dari daerah lain yang ada di Kabupaten Klungkung memiliki dua musim &nbsp;yaitu: musim kemarau dan musim hujan dengan suhu rata-rata 30&deg;C dengan curah hujan berkisar 450,00 mm/tahunnya.</span></div>\r\n', '2021-05-04 03:18:58'),
(7, 'Sejarah Desa', 'sejarah.png', '<h3 style=\"text-align:center\">Sejarah Desa Desoo</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>&nbsp;&nbsp;&nbsp;&nbsp; Desa berasal dari istilah dalam bahasa Sansekerta yang berarti tanah tumpah darah. Menurut definisi universal, desa adalah kumpulan dari beberapa permukiman di area pedesaan atau rural area. Istilah desa di Indonesia merujuk kepada pembagian wilayah administratif yang berada dibawah kecamatan dan dipimpin oleh seorang Kepala Desa. Desa adalah suatu kumpulan dari beberapa pemukiman kecil yang biasa disebut Kampung (Jabar), Dusun (Yogya), atau Banjar (Bali) dan Jorong (Sumbar). Sebutan lain untuk Kepala Desa adalah Kepala Kampung, Petinggi (Kaltim), Klebun (Madura), Pambakal (Kalsel), Kuwu (Cirebon), Hukum Tuan (Sulut).</div>\r\n', '2021-05-04 03:18:38');
